INSERT INTO t_personal_page_diary (ID, pageName, year, timeStamp, history) VALUES (69, 'majo', 2022, '2022:Mayo:28', '\nElla termin√≥ con su amor eterno... Al menos eso se nota. Ella volvi√≥ a buscarme y yo le dije lo que sent√≠a:\nque me trat√≥ muy mal y me sent√≠ mal.\nque me hizo llorar.\nque no me valor√≥.\ny luego la encontr√© en la calle y nos saludamos muy fr√≠amente... Espero no volver a mendigar amor nunca.\nEspero que nunca me vuelva a hablar.');
INSERT INTO t_personal_page_diary (ID, pageName, year, timeStamp, history) VALUES (70, 'majo', 2022, '2022:Mayo:29', '\nAnoche un amigo me escribi√≥ para ir a una fiesta... y caminamos unas cuantas cuadras ... OH sorpresa. Era en la casa de majo... yo no quise entrar me retir√© de inmediato.');
