INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (2, 'pel√≠cula de zombis', 2021, '2021:Diciembre:30', '\napenas comenzaba la infecci√≥n, luego vi al y a la protagonista, constituyeron un refugio.\n(un hueco en la tierra con una pipeta de cedante para dormir mucho tiempo) y luego despertar cuando todo pasara... ambos se metieron dentro... y luego una se√±ora envidiosa se meti√≥ al refugio para robarles la pipeta.');
INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (3, 'pel√≠cula de zombis', 2021, '2021:Diciembre:30', '\nellos se despertaron creyendo que era el final de la pandemia... luego salieron desnudos a la calle a celebrar y tener sexo. luego se dieron cuenta tarde que estaban rodeados... ambos corrieron pero atraparon a la chica... y el solo pudo ver impotente... el corre entre las praderas y ve como cada vez m√°s y m√°s zombis intentan atraparlo...\n\n\nluego son√≥ la alarma del celu.');
INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (4, 'violeta', 2022, '2022:Enero:19', '\nhubo una ni√±a en mi juventud.\nmona de ojos verdes, peque√±a de estatura... hermosa ... y con un culo rico y senos peque√±os.\n\nElla hace parte de mis traumas de impotencia sexual...\n\nso√±√© con ella:\n\nest√°bamos en una cama ri√©ndonos y hablando.');
INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (6, 'Johana Castrill√≥n', 2022, '2022:Abril:23', '\nella se encontraba en la puerta de mi casa de espaldas, y estaba hablando con una amiga... mi madre y yo nos encontramos en la sala de mi casa. yo la veo y luego mi madre la ve. Entonces mi madre cierra la puerta... y yo despierto.');
INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (7, 'Majo', 2022, '2022:Mayo:4', '\nme encontraba en unos bajos y ella viv√≠a en la parte m√°s baja. Yo no le hablaba por orgullo. Ve√≠a como entraban y sal√≠an hombres de su habitaci√≥n... y un d√≠a le habr√≠ la puerta y estaba teniendo relaciones con 2 indigentes ... majo le hac√≠a sexo oral a uno y el otro la tocaba... se volvi√≥ prostituta y ella me dijo:\n\n- Tu me abandonaste.\n\nyo llor√© y luego le ped√≠ una oportunidad... todo era una trampa. yo solo sent√≠a sus malas energ√≠as.\nluego de ello despert√©.');
INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (8, 'futuro solitario', 2022, '2022:Mayo:15', '\nme encontraba de viaje hacia mi pueblo, super drogado solo y triste... pero con distinci√≥n del avance del tiempo LAG. y luego tropec√©... y cuando cai observ√© una caja con un celular y dinero (no tanto) y fui a ver a mi madre y vi como uno de mis dientes incisivos se pudri√≥ y se desprendi√≥.');
INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (9, '√∫ltimo d√≠a de clases en la universidad', 2022, '2022:Mayo:25', '\nNos encontr√°bamos en el √∫ltimo d√≠a de clases, mis compa√±eros eran ni√±os y ten√≠amos uniformes.  Y el profesor dijo en voz alta:\n- j√≥venes hoy es su √∫ltimo d√≠a de clases.\ntodos guardaron silencio y se pusieron muy tristes.\nel profesor dijo en voz alta:\n- j√≥venes hagan grupos para su √∫ltimo trabajo.\nNadie se quiso hacer con migo.');
INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (10, 'Johana Castrill√≥n', 2022, '2022:Junio:3', '\nme encontraba solo entre miles de personas... era un puente con verdes prados.\nluego la depresi√≥n de sentirme aislado me hizo irme... camine por el puente y ah√≠ estaba ella.\nJohana y yo nos hablamos. y est√°bamos bien. caminamos y luego ella se alej√≥ y se fue con un tipo para nada agradable.');
INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (11, 'Manuela', 2022, '2022:Junio:5', '\nNos encontramos de casualidad en la calle y todo se dio super natural.\nsin rencores y una amistad muy bonita.\ncaminamos uno al lado del otro des-atrasandonos de nuestras vidas.\nElla era una mujer joven y super hermosa. y hablamos por horas... ella me abraz√≥ y me dijo que s√≥lo amigos y yo como un adulto acept√©. Ella me cont√≥ con dolor la muerte de su rata... y yo le cont√© sobre la m√≠a.\nElla era super sociable.\nsuper tierna.\nEra una mujercita super genial.');
INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (12, 'zombies', 2022, '2022:Junio:27', '\nme encontraba rodeado de miles de zombies en un edificio, y lo √∫nico que podr√≠a hacer era correr...\nluego al esconderme en un tejado not√© que la mayor√≠a eran mujeres, j√≥venes y hermosas (cuando est√°n vivas por lo menos) yo no conoc√≠a a ninguna... pero luego me di cuenta de que estaba so√±ando... y record√© que una vez alguien me dijo que no se pueden crear caras en los sue√±os... as√≠ que analice m√°s de cerca... le v√≠ la cara a varias... pero no conoc√≠a a ninguna.');
INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (13, 'vida social ', 2022, '2022:Julio:9', '\nEstoy con muchas personas en una fiesta y hablo...\ny a mi alrededor est√°n las personas que conozco tomando.');
INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (14, 'Alejandra blandon', 2022, '2022:Julio:12', '\nme encontraba estrenando mi Jeep, estaba en el pueblo...\nluego Alejandra me saluda y me dice:\nUfff! estrenando carro.\nyo le digo:\n- ven a dar una vuelta con migo.\ny ella se monta junto a su hermanito peque√±o.... 3 o 4 a√±os...\nluego empezamos a hacer el amor.');
INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (15, 'Johana Castrill√≥n ', 2022, '2022:Julio:28', '\nEra de noche en una ciudad y me encontr√© con ella... nos miramos y cruzamos un par de palabras.\nluego ella me invita a su casa donde su padre estaba muy disgustado de verme...\nhablamos y luego yo me ten√≠a que ir... me fui solo...\nluego me perd√≠ en la cuidad no sab√≠a d√≥nde estaba. No sab√≠a c√≥mo llegar a la casa de ella.');
INSERT INTO t_personal_dream_diary (ID, dreamName, year, timeStamp, history) VALUES (16, 'VIH positivo ', 2022, '2022:Julio:31', '\nme encontraba en una habitaci√≥n un poco oscura... de madera. con un espejo de cuerpo completo, una cama una silla una mesa y dos ni√±as de 12 y 13 a√±os... y un doctor muy joven.\nel doctor me pidi√≥ que me sentara y luego corto mi antebrazo con un bistur√≠... una sola gota cae y la toma con un palillo. Deja caer la gota sobre un papel tornasol rosa y este se pone blanco y luego dice:\npositivo ve al m√©dico a hacerte otra prueba. yo me pongo nervioso y parlanch√≠n... luego despierto.');
